/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "projeto-intenet-banking"
    }}>{`Projeto Intenet Banking`}</h1>
    <blockquote>
      <p parentName="blockquote">{`Se estiver criando uma nova release do produto se atente a seção `}<em parentName="p"><a parentName="em" {...{
            "href": "#Configurando-para-novos-releases"
          }}>{`Configurando para novos releases`}</a></em>{`
Se estiver clonando o projeto para trabalhar sobre uma release já existente se atente a seção `}<em parentName="p"><a parentName="em" {...{
            "href": "#Desenvolvimento"
          }}>{`Desenvolvimento`}</a></em>{` `}</p>
    </blockquote>
    <h2 {...{
      "id": "palavras-chave"
    }}>{`Palavras-chave`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://developer.android.com/studio/build/build-variants"
        }}>{`Flavors`}</a>{`: São tipos de compilação e são utilizados para organizar os diferentes releases. Podem ser configurados no menu (Build > Edit Flavors) no Android Studio`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://developer.apple.com/library/archive/featuredarticles/XcodeConcepts/Concept*Targets.html"
        }}>{`Targets/Schemes`}</a>{`: Definem um produto a ser gerado e contem as instruções necessárias para a geração do produto`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": ""
        }}>{`Packager`}</a>{` O packager é o processo reponsável por juntar os módulos javascript/typescript em um un`}<em parentName="li">{`co arquivo denominado `}</em>{`bundle`}<em parentName="li">{`, detectar alterações nesses arquivos e atualizar esse `}</em>{`bundle`}<em parentName="li">{`. Esse `}</em>{`bundle* é integrado ao executável da aplicação (.apk/.ipa)`}</li>
    </ul>
    <blockquote>
      <h2 parentName="blockquote" {...{
        "id": "importante"
      }}>{`IMPORTANTE**`}</h2>
      <p parentName="blockquote">{`Quando a aplicação é executada utilizando o comando `}<inlineCode parentName="p">{`react-native run-ios --scheme="Nome do scheme"`}</inlineCode>{` ou `}<inlineCode parentName="p">{`react-native run-android --variant="Nome do flavor"`}</inlineCode>{` o `}<strong parentName="p">{`packager`}</strong>{` depende da variável `}<em parentName="p">{`REACT_APP_COSTUMER`}</em>{` estar presente no sistema. Veja abaixo na seção `}<strong parentName="p"><em parentName="strong">{`Configuração do ambiente`}</em></strong>{` no 2º item, como definir e os valores aceitos para esta variável.`}</p>
    </blockquote>
    <h2 {...{
      "id": "para-novos-releases"
    }}>{`Para novos `}<strong parentName="h2">{`releases`}</strong></h2>
    <p>{`Abaixo descrevem-se as etapas necessárias para configurar uma nova release do projeto`}</p>
    <h3 {...{
      "id": "react-native"
    }}>{`REACT NATIVE`}</h3>
    <p>{`Dentro de `}<a parentName="p" {...{
        "href": "src/assets/themes/"
      }}>{`src/assets/themes`}</a>{` deve ser criado uma nova pasta com o conteúdo da nova release.
Os arquivos necessários para a nova release:`}</p>
    <ul>
      <li parentName="ul">{`colors.js (Com as cores do projeto)`}</li>
      <li parentName="ul">{`fonts.js (Com as fontes do projeto (Se forem adicionadas novas fontes, devem ser vinculadas no projeto nativo Android/iOS))`}</li>
      <li parentName="ul">{`images/ (As imagens utilizadas pelo projeto)`}</li>
    </ul>
    <h4 {...{
      "id": "ios"
    }}><strong parentName="h4">{`iOS`}</strong></h4>
    <ul>
      <li parentName="ul">{`Deve ser criado um novo `}<strong parentName="li">{`target`}</strong>{` para a nova release. Isso pode ser feito duplicando um target existente nas configurações do projeto. `}</li>
      <li parentName="ul">{`Dentro da aba `}<em parentName="li">{`Build Phases`}</em>{` na fase `}<em parentName="li">{`Bundle React Native code and images`}</em>{` deve se definida após a linha `}<em parentName="li">{`export NODE_BINARY=node`}</em>{` a linha `}<em parentName="li">{`export REACT_APP_COSTUMER="Uma das pastas configuradas no React Native"`}</em></li>
    </ul>
    <pre><code parentName="pre" {...{
        "className": "language-shell"
      }}>{`export NODE_BINARY=node
export REACT_APP_COSTUMER="Uma das pastas configuradas no React Native"
../node_modules/react-native/scripts/react-native-xcode.sh
`}</code></pre>
    <ul>
      <li parentName="ul">{`Deve ser configurado um novo scheme para buildar o target existente. Isso pode ser feito duplicando algum scheme existente.`}</li>
      <li parentName="ul">{`Os recursos de icone do aplicativo e launchscreen da nova release devem ser configurados da seguinte forma:`}</li>
      <li parentName="ul">{`Crie um novo pacote de recursos (.xcassets), e associe ao `}<em parentName="li">{`target`}</em>{` da release marcando-o na seção `}<strong parentName="li">{`Target membership`}</strong>{` (caso necessário desmarque de targets que não estão relacionados ao produto)`}</li>
      <li parentName="ul">{`Dentro do pacote de recursos crie um novo recurso de icone (App Icons & Launch Images > New iOS App Icon) nomeado `}<em parentName="li">{`AppIcon`}</em>{` e forneça a imagens para os ícones da release`}</li>
      <li parentName="ul">{`Ainda dentro do pacote de recursos crie um novo recurso de imagem (New Image Set) nomeado `}<em parentName="li">{`splash_screen`}</em>{` e forneça os arquivos de imagem da splash_screen`}</li>
    </ul>
    <h4 {...{
      "id": "android"
    }}><strong parentName="h4">{`ANDROID`}</strong></h4>
    <ul>
      <li parentName="ul">{`Deve ser criado um novo `}<strong parentName="li">{`flavor`}</strong>{` para a nova release. Pode ser definida pelo menu (Build > Edit Flavors) no Android Studio`}</li>
      <li parentName="ul">{`Dentro das configurações do novo `}<strong parentName="li">{`flavor`}</strong>{` deve ser definida a variável `}<em parentName="li">{`costumer`}</em>{` = "Uma das pastas configuradas no React Native" `}</li>
    </ul>
    <pre><code parentName="pre" {...{
        "className": "language-gradle"
      }}>{`//Arquivo /android/app/build.gradle
android {
  ...
  flavorDimensions 'dimension'
  productFlavors {
    flavorName {
      dimension = 'dimension'
      //Esta variável será usada pelo React Native para apontar para a pasta com os recursos da nova release
      costumer = 'Uma das pastas configuradas em /src/assets/themes/'
    }
  }
  ...
}
`}</code></pre>
    <h1 {...{
      "id": ""
    }}></h1>
    <h2 {...{
      "id": "configuração-para-desenvolvimento"
    }}>{`Configuração para Desenvolvimento`}</h2>
    <p>{`Abaixo estão descritos os requisitos necessários para um melhor desenvolvimento na arquitetura descrita na seção anterior`}</p>
    <h3 {...{
      "id": "configuração-do-ambiente"
    }}>{`Configuração do ambiente`}</h3>
    <ul>
      <li parentName="ul">{`No momento da elaboração deste manual a versão das ferramentas utilizadas no desenvolvimento eram:`}<ul parentName="li">
          <li parentName="ul">{`npm: 6.4.1`}</li>
          <li parentName="ul">{`node: 10.15.3`}</li>
          <li parentName="ul">{`java: 1.8.0_211`}</li>
          <li parentName="ul">{`XCode: 10.2.1`}</li>
        </ul></li>
      <li parentName="ul">{`A variável REACT_APP_COSTUMER deve ser definida no ambiente utilizado com o valor igual a algum dos diretórios da pasta `}<a parentName="li" {...{
          "href": "src/assets/themes"
        }}>{`src/assets/themes`}</a>{`. Isso se deve devido as variáveis configuradas no `}<strong parentName="li">{`flavor`}</strong>{`/`}<strong parentName="li">{`target`}</strong>{` não serem definidas na sessão do `}<strong parentName="li">{`packager`}</strong>{` iniciado pelo comando `}<em parentName="li">{`react-native run-android`}</em>{`/`}<em parentName="li">{`react-native run-ios`}</em></li>
    </ul>
    <h3 {...{
      "id": "executando-a-aplicação"
    }}>{`Executando a aplicação`}</h3>
    <ul>
      <li parentName="ul">{`Para iniciar o aplicativo deve ser utilizado o seguinte comando:`}</li>
    </ul>
    <h4 {...{
      "id": "android-1"
    }}>{`Android`}</h4>
    <ul>
      <li parentName="ul"><strong parentName="li">{`A variável REACT_APP_COSTUMER deve estar definida para que o packager do React Native possa apontar para os recursos da release`}</strong></li>
    </ul>
    <pre><code parentName="pre" {...{
        "className": "language-console"
      }}>{`# Esse comando é opcional e só é necessário quando a variável REACT_APP_COSTUMER foi definida dentro da sessão do terminal
react-native start 
react-native run-android --variant="O nome do flavor da release"Debug
`}</code></pre>
    <h4 {...{
      "id": "ios-1"
    }}>{`iOS`}</h4>
    <ul>
      <li parentName="ul"><strong parentName="li">{`A variável REACT_APP_COSTUMER deve estar definida para que o packager do React Native possa apontar para os recursos específicos da release`}</strong></li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`# Esse comando é opcional e só é necessário quando a variável REACT_APP_COSTUMER foi definida dentro da sessão do terminal
react-native start 
react-native run-ios --scheme="O nome do scheme da release"
`}</code></pre>
    <h3 {...{
      "id": "gerando-a-release"
    }}>{`Gerando a release`}</h3>
    <p>{`Para gerar uma versão de publicação da release, deve ser executado o seguinte processo para cada uma das plataformas:`}</p>
    <h4 {...{
      "id": "android-2"
    }}>{`Android`}</h4>
    <pre><code parentName="pre" {...{
        "className": "language-console"
      }}>{`cd android
.\\gradlew clean
.\\gradlew assemble(O nome do flavor)Release
`}</code></pre>
    <p>{`Após concluído o processo a APK para publicação estará disponível na pasta `}<a parentName="p" {...{
        "href": "android/app/build/outputs/release/"
      }}>{`android/app/build/outputs/release/O nome do flavor/arquivo.apk`}</a></p>
    <h4 {...{
      "id": "ios-2"
    }}>{`iOS`}</h4>
    <p>{`Selecione o scheme da release especifica, selecione o dispositivo `}<em parentName="p">{`Generic iOS Device`}</em>{` e selecione a opção (Product > Archive). Vale lembrar que para executar o archive deve ser utilizado um perfil de desenvolvedor na App Store`}</p>
    <h2 {...{
      "id": "erros-comuns"
    }}>{`Erros comuns`}</h2>
    <h3 {...{
      "id": "android-3"
    }}>{`Android`}</h3>
    <h3 {...{
      "id": "android-erro-ao-compilar-o-lottie-react-native-nullpointerexception"
    }}>{`(Android) Erro ao compilar o lottie-react-native NullPointerException`}</h3>
    <ul>
      <li parentName="ul">{`A versão do java utilizada pela equipe de desenvolvimento é a 1.8.0_211 versões mais recentes ou mais antigas não foram testadas e por isso podem não funcionar com a versão atual da aplicação.`}</li>
    </ul>
    <h3 {...{
      "id": "android-algum-erro-ao-gerar-a-release-ou-executar-a-aplicação"
    }}>{`(Android) Algum erro ao gerar a release ou executar a aplicação`}</h3>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`As vezes o Instant Run pode interferir na geração do APK, devido a isso recomenda-se desabilitar o Instant Run no Android Studio`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Quando o projeto é aberto pela primeira vez, o Android Studio oferece a opção de atualizar o Gradle. Essa alteração na versão do gradle ainda não funciona com a versão de algumas bibliotecas usadas no projeto, logo a atualização pode quebrar o build no Android. No momento de elaboração deste manual, a versão utilizada é a `}<em parentName="p">{`4.4-all`}</em>{` no arquivo `}<a parentName="p" {...{
            "href": "android/gradle/wrapper/gradle-wrapper.properties"
          }}>{`gradle-wrapper.properties`}</a></p>
      </li>
    </ul>
    <pre><code parentName="pre" {...{
        "className": "language-ini"
      }}>{`...
distributionUrl=https\\://services.gradle.org/distributions/gradle-4.4-all.zip
`}</code></pre>
    <h3 {...{
      "id": "ios-algum-erro-ao-gerar-a-release-ou-executar-a-aplicação"
    }}>{`(iOS) Algum erro ao gerar a release ou executar a aplicação`}</h3>
    <ul>
      <li parentName="ul">{`Erro ao gerar a release ou executar a aplicação.
`}<inlineCode parentName="li">{`'React/RCT*.h' file not found`}</inlineCode>{` Certifique-se de que dentro do `}<strong parentName="li">{`scheme`}</strong>{` da release o `}<strong parentName="li">{`target`}</strong>{` do React esta definido e o build paralelo desabilitado, já que a release depende do `}<strong parentName="li">{`target`}</strong>{` do React`}</li>
    </ul>
    <h3 {...{
      "id": "após-alterar-o-arquivo-babelrcjs-ou-o-valor-de-react_app_costumer-o-aplicativo-obtém-os-arquivos-do-valor-anterior"
    }}>{`Após alterar o arquivo .babelrc.js ou o valor de REACT_APP_COSTUMER o aplicativo obtém os arquivos do valor anterior`}</h3>
    <ul>
      <li parentName="ul">{`O packager mantém uma versão em cache do arquivo `}<a parentName="li" {...{
          "href": ".babelrc.js"
        }}>{`.babelrc.js`}</a>{`. Dessa forma uma alteração do arquivo ou da variável pode não se refletir de maneira imediata. Para que o packager utilize a nova versão do arquivo ou variavel é necessário utilizar o comando.`}</li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`react-native start --reset-cache
`}</code></pre>
    <h2 {...{
      "id": "sugestões"
    }}>{`Sugestões`}</h2>
    <h3 {...{
      "id": "para-gerenciar-as-versões-do-nodejs-e-npm"
    }}>{`Para gerenciar as versões do NodeJS e npm`}</h3>
    <ul>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://github.com/nvm-sh/nvm"
          }}>{`nvm`}</a>{`: O `}<em parentName="p">{`nvm`}</em>{` é um conjunto de comandos que sao instalados no ambiente e permitem gerenciar de maneira facil diversas versões do `}<em parentName="p">{`NodeJS & npm`}</em></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Para gerenciar a execução de diversas releases do projeto podem ser criados scripts com os comandos dentro do arquivo `}<a parentName="p" {...{
            "href": "package.json"
          }}>{`package.json`}</a>{` e depois executá-lo com `}<inlineCode parentName="p">{`npm run nome_do_script`}</inlineCode></p>
      </li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
